import{c as e}from"./app.43fe0c63.js";import{_ as o}from"./plugin-vue_export-helper.21dcd24c.js";var a="/blog-web/assets/20200323141523501_10435.245c78b8.png",r="/blog-web/assets/20200323140805927_6326.5c70df4d.png",s="/blog-web/assets/20200323151214027_14131.b1df3cad.gif",n="/blog-web/assets/20200323154804908_20146.ed24823e.png",t="/blog-web/assets/20200323155446037_13472.329c97ff.png",i="/blog-web/assets/20200323112945044_24938.e32bf921.gif",p="/blog-web/assets/20191014184640787_5568.4d01c171.png",c="/blog-web/assets/20191014184712880_7396.f61ae6ee.png",l="/blog-web/assets/20191014184743510_17089.145c7969.png",d="/blog-web/assets/20191111171315127_1931.de338759.png",g="/blog-web/assets/20191111172316056_1919.d36dd6c4.png",h="/blog-web/assets/20191111172804898_11749.061bf88f.png",m="/blog-web/assets/20191111172919623_13088.a9644f70.png";const u={},b=e('<h1 id="\u5F00\u53D1\u8C03\u8BD5" tabindex="-1"><a class="header-anchor" href="#\u5F00\u53D1\u8C03\u8BD5" aria-hidden="true">#</a> \u5F00\u53D1\u8C03\u8BD5</h1><p>\u53C2\u8003\uFF1A<a href="https://developers.google.com/web/tools/chrome-devtools" target="_blank" rel="noopener noreferrer">Chrome \u5F00\u53D1\u8005\u5DE5\u5177</a></p><p>\u8C03\u8BD5\u662F\u6307\u5728\u4E00\u4E2A\u811A\u672C\u4E2D\u627E\u51FA\u5E76\u4FEE\u590D\u9519\u8BEF\u7684\u8FC7\u7A0B\uFF0C\u73B0\u4EE3\u6D4F\u89C8\u5668\u7684\u5F00\u53D1\u8005\u5DE5\u5177\u4E2D\u4E3A\u8C03\u8BD5\u63D0\u4F9B\u4E86\u4E00\u4E2A\u7279\u6B8A\u7684\u7528\u6237\u754C\u9762\uFF0C\u5B83\u4E5F\u53EF\u4EE5\u8BA9\u6211\u4EEC\u4E00\u6B65\u6B65\u5730\u8DDF\u8E2A\u4EE3\u7801\u4EE5\u67E5\u770B\u5F53\u524D\u5B9E\u9645\u8FD0\u884C\u60C5\u51B5\u3002</p><p>\u{1F4A1} \u6253\u5F00 Chrome \u5F00\u53D1\u8005\u5DE5\u5177\u5FEB\u6377\u952E <code>F12</code>\uFF08Mac \u5FEB\u6377\u952E\u662F <code>Cmd+Opt+I</code>\uFF09</p><h2 id="\u521B\u5EFA\u672C\u5730-web-\u670D\u52A1\u5668" tabindex="-1"><a class="header-anchor" href="#\u521B\u5EFA\u672C\u5730-web-\u670D\u52A1\u5668" aria-hidden="true">#</a> \u521B\u5EFA\u672C\u5730 Web \u670D\u52A1\u5668</h2><p>\u521B\u5EFA\u672C\u5730 Web \u670D\u52A1\u5668\u53EF\u7528\u4E8E\u66F4\u65B9\u4FBF\u5730\u5BF9\u7F51\u7AD9\u8FDB\u884C\u6D4B\u8BD5\u548C\u6A21\u62DF\u3002</p><h2 id="\u63A7\u5236\u53F0" tabindex="-1"><a class="header-anchor" href="#\u63A7\u5236\u53F0" aria-hidden="true">#</a> \u63A7\u5236\u53F0</h2><p>\u9875\u9762\u7684\u811A\u672C\u8FD0\u884C\u7684\u9519\u8BEF\u4F1A\u5728\u5F00\u53D1\u8005\u5DE5\u5177\u7684\u63A7\u5236\u53F0\u4E2D\u8F93\u51FA\u3002</p><p>Chrome \u6D4F\u89C8\u5668\u63A7\u5236\u53F0\u6253\u5F00\u65B9\u5F0F</p><ul><li>\u65B9\u6CD5\u4E00\uFF1A<code>F12</code> \u6253\u5F00\u5F00\u53D1\u8005\u5DE5\u5177\u518D\u70B9\u51FB\u9009\u62E9 <code>Console</code> \u6807\u7B7E\u6253\u5F00\u63A7\u5236\u53F0\uFF0C\u5FEB\u6377\u952E <code>Ctrl + Shift + J</code>\u6253\u5F00\u63A7\u5236\u53F0\u6807\u7B7E</li><li>\u65B9\u6CD5\u4E8C\uFF1A\u5728\u5176\u4ED6\u6807\u7B7E\u9875\u9762\u6309 <code>Esc</code> \u4E0B\u65B9\u4F1A\u51FA\u73B0\u4E00\u4E2A\u63A7\u5236\u53F0</li></ul><p><img src="'+a+'" alt="Chrome \u5F00\u53D1\u8005\u5DE5\u5177\u63A7\u5236\u53F0"></p><p>\u63A7\u5236\u53F0 Console \u53EF\u4EE5\u5F53\u4F5C<strong>\u6C99\u76D2</strong>\u7528\u4E8E\u6D4B\u8BD5 JavaScript \u4EE3\u7801\uFF0C\u7C7B\u4F3C\u4E8E IDLE \u63D0\u4F9B\u5373\u65F6\u4EA4\u4E92\u5F0F\u7684\u6A21\u5F0F\u3002</p><p>\u8F93\u5165 JavaScript \u4EE3\u7801\u5E76\u6309 <code>Enter</code> \u5373\u65F6\u6267\u884C \uFF0C\u6D4F\u89C8\u5668\u63A7\u5236\u53F0\u4E2D\u8C03\u8BD5\u4EE3\u7801<a href="https://wiki.jikexueyuan.com/project/chrome-devtools/using-the-console.html" target="_blank" rel="noopener noreferrer">\u5E38\u7528\u529F\u80FD</a></p><ul><li><p>\u51FD\u6570 <code>console.log()</code> \u8F93\u51FA\u65E5\u5FD7\uFF0C\u7528\u4E8E\u5411 JavaScript \u63A7\u5236\u53F0\u663E\u793A\u5185\u5BB9</p><ul><li>\u4E3B\u8981\u7528\u4E8E\u8F93\u51FA\u503C\u5230\u63A7\u5236\u53F0\uFF0C\u4EE5\u63D0\u4F9B\u6709\u7528\u7684\u53CD\u9988\uFF08\u4E0E\u51FD\u6570\u7684 <code>return</code> \u8FD4\u56DE\u8BED\u53E5\u4E0D\u540C\u5206\uFF09</li><li>\u9ED8\u8BA4\u8FD4\u56DE\u503C\u662F <code>undefined</code></li><li>\u9700\u8981\u540C\u65F6\u8F93\u5165\u591A\u4E2A\u53C2\u6570\u4EE5\u4FBF\u4F9D\u6B21\u6267\u884C\uFF0C\u4F7F\u7528\u9017\u53F7 <code>,</code> \u5206\u9694</li></ul></li><li><p>\u63D2\u5165\u591A\u884C\u4EE3\u7801\u65F6\u6309 <code>Shift+Enter</code> \u8FDB\u884C\u6362\u884C</p></li><li><p>\u6E05\u7A7A\u63A7\u5236\u53F0\u591A\u79CD\u65B9\u6CD5</p><ul><li>\u8F93\u5165\u51FD\u6570 <code>clear()</code></li><li>\u70B9\u51FB\u5DE6\u4E0A\u89D2\u300C\u7981\u6B62\u6309\u94AE\u300D\u{1F6AB}</li><li>\u5FEB\u6377\u952E <code>Ctrl + L</code></li></ul></li><li><p>\u8F93\u5165 <code>monitorEvents(elementToWatch)</code> \u53EF\u4EE5\u76D1\u63A7\u9009\u4E2D\u5143\u7D20\u53D1\u751F\u7684\u4E8B\u4EF6</p></li><li><p>\u8F93\u5165 <code>$0</code> \u5728\u63A7\u5236\u53F0\u8F93\u51FA\u6240\u6709\u4E8B\u4EF6\u7684\u65E5\u5FD7</p></li></ul><h2 id="\u8D44\u6E90\u9762\u677F" tabindex="-1"><a class="header-anchor" href="#\u8D44\u6E90\u9762\u677F" aria-hidden="true">#</a> \u8D44\u6E90\u9762\u677F</h2><p><img src="'+r+'" alt="Sources-pannel"></p><p>\u9009\u62E9 <code>Sources</code> \u8D44\u6E90\u9762\u677F\uFF0C\u53EF\u4EE5\u53C2\u770B\u4F9D\u9644\u4E8E\u8BE5\u9875\u9762\u7684\u6587\u4EF6\uFF0C\u5305\u62EC HTML\u3001JavaScript\u3001CSS \u548C \u56FE\u7247\u7B49\u8D44\u6E90\u3002</p><p>\u9009\u4E2D\u6587\u4EF6\u540E\uFF0C\u5176\u6E90\u7801\u4F1A\u5728\u4E2D\u95F4\u663E\u5F0F\u3002</p><p>\u53F3\u4FA7\u7684 JavaScript \u8C03\u8BD5\u533A\u57DF\u5C31\u662F\u7528\u6765\u8FDB\u884C\u4E00\u6B65\u6B65\u5730\u8DDF\u8E2A\u6D4B\u8BD5\u4EE3\u7801\u3002</p><h3 id="\u65AD\u70B9" tabindex="-1"><a class="header-anchor" href="#\u65AD\u70B9" aria-hidden="true">#</a> \u65AD\u70B9</h3><p>\u65AD\u70B9 breakpoints \u662F\u8C03\u8BD5\u5668\u4F1A<strong>\u81EA\u52A8\u6682\u505C</strong> JavaScript \u6267\u884C\u7684\u5730\u65B9\u3002\u5F53\u4EE3\u7801\u88AB\u6682\u505C\u65F6\u53EF\u4EE5\u8FDB\u884C\u68C0\u67E5\u5F53\u524D\u7684\u53D8\u91CF\uFF0C\u5728\u63A7\u5236\u53F0\u6267\u884C\u547D\u4EE4\u7B49\u64CD\u4F5C\uFF0C\u901A\u8FC7\u8BBE\u7F6E\u65AD\u70B9\u53EF\u4EE5\u5BF9\u4EE3\u7801\u8FDB\u884C\u8C03\u8BD5\u3002</p><p><img src="'+s+'" alt="breakpoints"></p><p>\u5728\u4EE3\u7801\u7F16\u8F91\u5668\u9875\u9762\u6253\u5F00\u811A\u672C\uFF0C\u70B9\u51FB\u811A\u672C\u8BED\u53E5\u5DE6\u4FA7\u76F8\u5E94\u7684<strong>\u884C\u53F7</strong>\u5373\u53EF\u521B\u5EFA\u65AD\u70B9\uFF08\u84DD\u8272\u7BAD\u5934\u6807\u6CE8\uFF09\u3002\u5728\u53F3\u4FA7\u7684 JavaScript \u8C03\u8BD5\u9762\u677F\u4E2D\u6709\u76F8\u65AD\u70B9\u5217\u8868\uFF0C\u53EF\u4EE5\u53D6\u6D88\u9009\u4E2D\u65AD\u70B9\u6765\u4E34\u65F6\u7981\u7528\u5BF9\u5E94\u7684\u65AD\u70B9\uFF0C\u70B9\u51FB\u65AD\u70B9\u53EF\u4EE5\u5FEB\u901F\u8DF3\u8F6C\u81F3\u76F8\u5E94\u7684\u6E90\u4EE3\u7801\uFF0C\u4E5F\u53EF\u4EE5\u53F3\u952E\u9009\u62E9\u79FB\u9664\u6765\u5220\u9664\u65AD\u70B9\u3002</p><p>\u{1F4A1} \u5F53\u6211\u4EEC\u9700\u8981\u5728\u7279\u5B9A\u7684\u53D8\u91CF\u503C\u6216\u53C2\u6570\u7684\u60C5\u51B5\u4E0B\u6682\u505C\u7A0B\u5E8F\u6267\u884C\u65F6\uFF0C\u53EF\u4EE5\u8BBE\u7F6E\u6761\u4EF6\u65AD\u70B9 conditional breakpoint \u5F53\u7ED9\u5B9A\u7684\u8868\u8FBE\u5F0F\u4E3A\u771F\uFF08\u5373\u6EE1\u8DB3\u6761\u4EF6\uFF09\u65F6\u624D\u4F1A\u88AB\u89E6\u53D1\u3002\u5728\u884C\u53F7\u4E0A\u53F3\u952E\u9009\u62E9\u5F39\u51FA\u83DC\u5355\u7684 <code>add conditional breakpoint...</code> \u521B\u5EFA\u4E00\u4E2A\u6761\u4EF6\u65AD\u70B9\u3002</p><p>\u{1F4A1} \u53EF\u4EE5\u901A\u8FC7 JavaScript \u8C03\u7528\u9762\u677F\u9876\u90E8\u7684\u6309\u94AE \u542F\u7528/\u7981\u7528\u6240\u6709\u7684\u65AD\u70B9 Deactivate breakpoints \u6279\u91CF\u64CD\u4F5C\uFF0C\u5FEB\u6377\u952E <code>Ctrl + F8</code>\u3002 <img src="'+n+`" alt="deactivate-breakpoints"></p><p>\u{1F4A1} \u9664\u4E86\u5728\u5F00\u53D1\u8005\u5DE5\u5177\u4E2D\u624B\u52A8\u7ED9\u811A\u672C\u8BBE\u7F6E\u65AD\u70B9\u5916\uFF0C\u8FD8\u53EF\u4EE5\u5C06\u300C\u65AD\u70B9\u300D\u9884\u5148\u7F16\u5199\u8FDB\u5165\u6E90\u6587\u4EF6\uFF0C\u5728\u4EE3\u7801\u7F16\u8F91\u5668\u4E2D\u4E3A\u811A\u672C\u6E90\u7801\u6DFB\u52A0\u8BED\u53E5 <code>debugger;</code> \u6D4F\u89C8\u5668\u7684\u8C03\u8BD5\u5668\u4F1A\u5728\u8BE5\u4F4D\u7F6E\u505C\u6B62\u811A\u672C\u7684\u8FD0\u884C\u3002</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code><span class="token keyword">function</span> <span class="token function">hello</span><span class="token punctuation">(</span><span class="token parameter">name</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  <span class="token keyword">let</span> phrase <span class="token operator">=</span> <span class="token template-string"><span class="token template-punctuation string">\`</span><span class="token string">Hello, </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">\${</span>name<span class="token interpolation-punctuation punctuation">}</span></span><span class="token string">!</span><span class="token template-punctuation string">\`</span></span><span class="token punctuation">;</span>

  <span class="token keyword">debugger</span><span class="token punctuation">;</span>  <span class="token comment">// &lt;-- \u8C03\u8BD5\u5668\u4F1A\u5728\u8FD9\u505C\u6B62</span>

  <span class="token function">say</span><span class="token punctuation">(</span>phrase<span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br></div></div><p>\u{1F4A1} <strong>\u542F\u52A8/\u7981\u7528\u51FA\u73B0\u9519\u8BEF\u65F6\u81EA\u52A8\u6682\u505C\u811A\u672C <code>Pause on exceptions</code></strong> \u662F\u53E6\u4E00\u79CD\u6682\u505C\u811A\u672C\u8FD0\u884C\u7684\u65B9\u5F0F\uFF0C\u4EFB\u4F55\u4E00\u4E2A\u811A\u672C\u7684\u9519\u8BEF\u90FD\u4F1A\u5BFC\u81F4\u8BE5\u811A\u672C\u6267\u884C\u81EA\u52A8\u6682\u505C\uFF0C\u7136\u540E\u53EF\u4EE5\u5206\u6790\u5F53\u524D\u7684\u53D8\u91CF\u6765\u770B\u4E00\u4E0B\u4EC0\u4E48\u51FA\u9519\u4E86\u3002 <img src="`+t+'" alt="pause-on-exceptions"></p><h3 id="\u8DDF\u8E2A\u6267\u884C" tabindex="-1"><a class="header-anchor" href="#\u8DDF\u8E2A\u6267\u884C" aria-hidden="true">#</a> \u8DDF\u8E2A\u6267\u884C</h3><p>\u8BBE\u7F6E\u597D\u65AD\u70B9\u540E\u5C31\u53EF\u4EE5\u6267\u884C\u811A\u672C\u4EE5\u8DDF\u8E2A\u8C03\u8BD5\u4EE3\u7801\uFF0C\u6839\u636E\u76F8\u5E94\u7684\u89E6\u53D1\u6761\u4EF6\u8FD0\u884C\u811A\u672C\uFF0C\u5982\u91CD\u65B0\u52A0\u8F7D\u9875\u9762\u3002</p><p>\u5728 JavaScript \u8C03\u7528\u9762\u677F\u4F1A\u663E\u5F0F\u811A\u672C\u8FD0\u884C\u8FC7\u7A0B\u4E2D\u8BE6\u7EC6\u4FE1\u606F\uFF1A</p><ul><li><p><strong>\u5BDF\u770B watch</strong> \u663E\u793A\u4EFB\u610F\u8868\u8FBE\u5F0F\u7684\u5F53\u524D\u503C\u3002\u53EF\u4EE5\u70B9\u51FB\u52A0\u53F7 <code>+</code> \u7136\u540E\u8F93\u5165\u4E00\u4E2A\u8868\u8FBE\u5F0F\u3002\u8C03\u8BD5\u5668\u5C06\u968F\u65F6\u663E\u793A\u5B83\u7684\u503C\uFF0C\u5E76\u5728\u6267\u884C\u8FC7\u7A0B\u4E2D\u81EA\u52A8\u91CD\u65B0\u8BA1\u7B97\u8BE5\u8868\u8FBE\u5F0F\u3002</p></li><li><p><strong>\u8C03\u7528\u6808 call stack</strong> \u663E\u793A\u5D4C\u5957\u7684\u8C03\u7528\u94FE\uFF0C\u5373\u4E0D\u65AD\u8FDB\u884C\u7684\u51FD\u6570\u8C03\u7528\u987A\u5E8F\u3002\u5806\u6808\u5E95\u90E8\u7684\u51FD\u6570\u662F\u7B2C\u4E00\u4E2A\u8FD0\u884C\u7684\u51FD\u6570\uFF0C\u5B83\u4F1A\u8C03\u7528\u5806\u6808\u4E0A\u7684\u7B2C\u4E8C\u4E2A\u51FD\u6570\uFF0C\u4EE5\u6B64\u7C7B\u63A8\u3002\u51FD\u6570\u4E00\u76F4\u4FDD\u7559\u5728\u5806\u6808\u4E0A\uFF0C\u76F4\u5230\u524D\u9762\u7684\u51FD\u6570\u8FD4\u56DE\u4E86\u3002 <img src="'+i+'" alt="\u70B9\u51FB\u5806\u6808\u9879\uFF0C\u8C03\u8BD5\u5668\u5C06\u8DF3\u5230\u5BF9\u5E94\u7684\u4EE3\u7801\u5904"></p></li><li><p><strong>\u4F5C\u7528\u57DF Scope</strong> \u663E\u793A\u5F53\u524D\u7684\u53D8\u91CF\u3002<code>Local</code> \u663E\u793A\u5F53\u524D\u51FD\u6570\u4E2D\u7684\u5C40\u90E8\u53D8\u91CF\uFF0C\u5B83\u4EEC\u7684\u4EE3\u7801\u4F1A\u5728\u4EE3\u7801\u7F16\u8F91\u9762\u677F\u4E2D\u9AD8\u4EAE\u663E\u793A\u51FA\u6765\u3002<code>Global</code> \u8868\u793A\u5168\u5C40\u53D8\u91CF\uFF08\u4E0D\u5728\u4EFB\u4F55\u51FD\u6570\u4E2D\uFF09\u3002</p></li></ul><p>\u5F53\u811A\u672C\u9047\u5230\u65AD\u70B9\u65F6\u4F1A\u6682\u505C\uFF0C\u5728 JavaScript \u8C03\u8BD5\u9762\u677F\u9876\u90E8\u4F1A\u6709\u4E0D\u540C\u64CD\u4F5C\u6309\u94AE\u4EE5\u4E0D\u540C\u7684\u65B9\u5F0F\u7EE7\u7EED\u6267\u884C\u811A\u672C\uFF1A</p><ul><li><strong>\u6062\u590D Resume</strong> \u7EE7\u7EED\u6267\u884C\uFF0C\u5FEB\u6377\u952E\u4E3A <code>F8</code>\u3002\u5982\u679C\u6CA1\u6709\u5176\u4ED6\u7684\u65AD\u70B9\uFF0C\u90A3\u4E48\u7A0B\u5E8F\u5C31\u4F1A\u7EE7\u7EED\u6267\u884C\uFF0C\u5E76\u4E14\u8C03\u8BD5\u5668\u4E0D\u4F1A\u518D\u63A7\u5236\u7A0B\u5E8F\u3002</li><li><strong>\u4E0B\u4E00\u6B65 Step</strong> \u8FD0\u884C\u4E0B\u4E00\u6761\u6307\u4EE4\u5FEB\u6377\u952E <code>F9</code>\u3002\u4E00\u6B21\u63A5\u4E00\u6B21\u5730\u70B9\u51FB\u6B64\u6309\u94AE\uFF0C\u6574\u4E2A\u811A\u672C\u7684\u6240\u6709\u8BED\u53E5\u4F1A\u88AB\u9010\u4E2A\u6267\u884C\uFF08\u5982\u679C\u4E0B\u4E00\u6B65\u662F\u8C03\u7528\u51FD\u6570\uFF0C\u5C31\u4F1A\u8FDB\u5165\u51FD\u6570\u5185\u90E8\u5E76\u5728\u7B2C\u4E00\u884C\u6682\u505C\u6267\u884C\uFF0C\u4E14\u5FFD\u7565\u5F02\u6B65\u65B9\u6CD5\uFF09\u3002</li><li><strong>\u8DE8\u6B65 Step over</strong> \u8FD0\u884C\u4E0B\u4E00\u6761\u6307\u4EE4\uFF0C\u5FEB\u6377\u952E <code>F10</code>\u3002\u8FD0\u884C\u4E0B\u4E00\u6761\u6307\u4EE4\uFF0C\u4F46\u5982\u679C\u4E0B\u4E00\u6B65\u662F\u8C03\u7528\u51FD\u6570\u5219\u76F4\u63A5\u6267\u884C\u5B8C\u8BE5\u51FD\u6570\u540E\u7ACB\u5373\u6682\u505C\uFF0C\u5982\u679C\u6211\u4EEC\u5BF9\u8BE5\u51FD\u6570\u7684\u5185\u90E8\u6267\u884C\u4E0D\u611F\u5174\u8DA3\uFF0C\u8FD9\u547D\u4EE4\u4F1A\u5F88\u6709\u7528\u3002</li><li><strong>\u6B65\u5165 Step into</strong> \u548C<strong>\u4E0B\u4E00\u6B65 Step</strong> \u7C7B\u4F3C\uFF0C\u5FEB\u6377\u952E <code>F11</code>\u3002\u4F46\u5728\u5F02\u6B65\u51FD\u6570\u8C03\u7528\u60C5\u51B5\u4E0B\u8868\u73B0\u4E0D\u540C\uFF0C\u4F1A\u8FDB\u5165\u5230\u4EE3\u7801\u4E2D\u5E76\u7B49\u5F85\uFF08\u5982\u679C\u9700\u8981\uFF09\u3002</li><li><strong>\u6B65\u51FA Step out</strong> \u7EE7\u7EED\u6267\u884C\u5230\u5F53\u524D\u51FD\u6570\u7684\u672B\u5C3E\uFF0C\u5FEB\u6377\u952E <code>Shift+F11</code>\u3002\u5F53\u5076\u7136\u5730\u8FDB\u5165\u5230\u4E00\u4E2A\u5D4C\u5957\u8C03\u7528\uFF0C\u4F46\u5BF9\u8FD9\u4E2A\u51FD\u6570\u4E0D\u611F\u5174\u8DA3\u65F6\u60F3\u5C3D\u53EF\u80FD\u7684\u7EE7\u7EED\u6267\u884C\u5230\u6700\u540E\u3002</li></ul><h2 id="\u6A21\u62DF\u5668" tabindex="-1"><a class="header-anchor" href="#\u6A21\u62DF\u5668" aria-hidden="true">#</a> \u6A21\u62DF\u5668</h2><p>\u53C2\u8003\uFF1A</p><ul><li><a href="https://developers.google.com/web/tools/chrome-devtools/device-mode/?utm_source=dcc&amp;utm_medium=redirect&amp;utm_campaign=2016q3" target="_blank" rel="noopener noreferrer">\u4F7F\u7528 Chrome DevTools \u4E2D\u7684 Device Mode \u6A21\u62DF\u79FB\u52A8\u8BBE\u5907</a></li><li><a href="http://www.css88.com/doc/chrome-devtools/device-mode/" target="_blank" rel="noopener noreferrer">\u4F7F\u7528<strong>\u8BBE\u5907\u6A21\u5F0F</strong>\u6A21\u62DF\u79FB\u52A8\u8BBE\u5907</a></li></ul><p>\u901A\u8FC7\u4F7F\u7528\u4E91\u6A21\u62DF\u5668\u5982 <a href="http://www.browserstack.com/" target="_blank" rel="noopener noreferrer">BrowserStack</a> \u6216 Chrome \u7684\u5F00\u53D1\u8005\u5DE5\u5177\u4E2D\u7684 Device Mode \u9488\u5BF9\u4E0D\u540C\u8BBE\u5907\u8FDB\u884C\u7F51\u9875\u6D4B\u8BD5</p><p><img src="'+p+'" alt="Device Mode"></p><p>\u53EF\u9009\u62E9\u591A\u79CD\u9884\u8BBE\u7684\u8BBE\u5907\uFF08\u5C3A\u5BF8\uFF09 <img src="'+c+'" alt="Different Device"></p><p>\u4E5F\u53EF\u4EE5\u5B9A\u5236\u5316\u8BBE\u5907 <img src="'+l+'" alt="Custom Device"></p><h2 id="chrome-\u8FDC\u7A0B\u8C03\u8BD5" tabindex="-1"><a class="header-anchor" href="#chrome-\u8FDC\u7A0B\u8C03\u8BD5" aria-hidden="true">#</a> Chrome \u8FDC\u7A0B\u8C03\u8BD5</h2><p>\u5728\u771F\u5B9E\u8BBE\u5907\u4E0A\u6D4B\u8BD5\u5341\u5206\u91CD\u8981\uFF0C\u53EF\u5229\u7528 Chrome \u5BF9\u79FB\u52A8\u8BBE\u5907\u8FDB\u884C\u8FDC\u7A0B\u8C03\u8BD5</p><h3 id="android-\u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5" tabindex="-1"><a class="header-anchor" href="#android-\u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5" aria-hidden="true">#</a> Android \u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5</h3><p>\u53C2\u8003\uFF1A<a href="https://developers.google.cn/web/tools/chrome-devtools/remote-debugging/?hl=zh" target="_blank" rel="noopener noreferrer">\u5728\u88C5\u6709 Chrome \u7684 Android \u4E0A\u8FDC\u7A0B\u8C03\u8BD5</a></p><p>\u4F7F\u7528 Chrome \u5BF9 Android \u8FDB\u884C\u8FDC\u7A0B\u8C03\u8BD5\uFF0C\u684C\u9762\u7AEF <a href="https://www.google.com/chrome/browser/canary.html" target="_blank" rel="noopener noreferrer">\u4E0B\u8F7D Chrome Canary</a> \uFF08\u8FD9\u662F Chrome \u5F00\u53D1\u8005\u7248\u672C\uFF0C\u4F7F\u7528 Chrome \u4E5F\u540C\u6837\u53EF\u4EE5\uFF09\u548C\u79FB\u52A8\u7AEF\u90FD\u9700\u8981\u5B89\u88C5\u6709Chrome \u6D4F\u89C8\u5668\u3002</p><ol><li><p>\u5728 Android \u8BBE\u5907\u4E0A\u6253\u5F00 USB \u8C03\u8BD5\uFF08\u4EE5\u4E0B\u6B65\u9AA4\u9002\u7528\u4E8E \u575A\u679C pro \u7CFB\u7EDF\u4E3A <code>v6.7.1</code>\uFF09</p><ul><li><code>\u8BBE\u7F6E</code> -&gt; <code>\u5173\u4E8E\u672C\u673A</code> -&gt; \u4E0B\u62C9\u5230\u6700\u540E\uFF0C\u4E0D\u65AD\u70B9\u51FB <code>\u8F6F\u4EF6\u7248\u672C</code>\uFF08\u7EA67\u6B21\uFF09\u81F3\u63D0\u793A\u5F00\u542F\u4E86 <code>\u5F00\u53D1\u8005\u9009\u9879</code> Developer Option</li><li><code>\u5168\u5C40\u9AD8\u7EA7\u8BBE\u7F6E</code> -&gt; <code>\u5F00\u53D1\u8005\u9009\u9879</code> -&gt; \u6253\u5F00 <code>USB \u8C03\u8BD5</code> Enable USB Debugging</li></ul></li><li><p>\u5728\u684C\u9762\u7AEF Chrome \u5F00\u542F <code>Remote devices</code> \u6807\u7B7E\u680F\uFF0C\u5E76\u786E\u4FDD\u5F00\u542F <code>Discover USB devices</code><img src="'+d+'" alt="Remote devices"></p></li><li><p>\u4F7F\u7528 USB \u7535\u7F06\u5C06 Android \u8BBE\u5907\u76F4\u63A5\u8FDE\u63A5\u5230\u5F00\u53D1\u7684\u8BA1\u7B97\u673A\uFF0C\u5E76\u6253\u5F00\u79FB\u52A8\u7AEF Chrome</p><ul><li>\u79FB\u52A8\u7AEF\u53EF\u80FD\u4F1A\u5F39\u51FA\u63D0\u793A\uFF0C\u8BF7\u4FE1\u4EFB\u8BA1\u7B97\u673A\u5BF9\u5176\u8BBF\u95EE</li><li>\u9996\u6B21\u8FDE\u63A5\u65F6\uFF0C\u901A\u5E38\u4F1A\u770B\u5230 DevTools \u68C0\u6D4B\u5230\u672A\u77E5\u8BBE\u5907\u3002 \u5982\u679C\u60A8 Android \u8BBE\u5907\u7684\u578B\u53F7\u540D\u79F0\u4E0B\u663E\u793A<strong>\u7EFF\u8272\u5706\u70B9</strong>\u548C Connected \u6587\u672C\uFF0C\u5219\u8868\u793A DevTools \u5DF2\u4E0E\u60A8\u7684\u8BBE\u5907\u6210\u529F\u5EFA\u7ACB\u8FDE\u63A5\u3002</li></ul></li><li><p>\u8C03\u8BD5 <img src="'+g+'" alt="\u8C03\u8BD5_1"></p><p>\u4E5F\u53EF\u4EE5\u8BBF\u95EE <code>chrome://inspect/</code>\u8FDB\u884C\u8FDC\u7AEF\u8C03\u8BD5\uFF0C\u70B9\u51FB <code>inspect fallback</code> \u6253\u5F00\u5B9E\u65F6\u540C\u6B65\u9884\u89C8\u8C03\u8BD5\u7A97\u53E3 <img src="'+h+'" alt="\u8C03\u8BD5_2"> \u5728\u8BE5\u9875\u9762\u4E0A\u4FEE\u6539\u4EE3\u7801\uFF0C\u53EF\u540C\u65F6\u5728\u79FB\u52A8\u7AEF\u548C\u684C\u9762\u7AEF\u9884\u89C8\u7A97\u53E3\u67E5\u770B <img src="'+m+'" alt="\u8C03\u8BD5_3"></p></li></ol><h3 id="ios-\u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5" tabindex="-1"><a class="header-anchor" href="#ios-\u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5" aria-hidden="true">#</a> iOS \u8BBE\u5907\u8FDC\u7A0B\u8C03\u8BD5</h3><ul><li><a href="https://github.com/google/ios-webkit-debug-proxy" target="_blank" rel="noopener noreferrer">iOS WebKit \u8C03\u8BD5\u4EE3\u7406</a>(\u82F1)</li><li><a href="https://www.smashingmagazine.com/2014/09/testing-mobile-emulators-simulators-remote-debugging/" target="_blank" rel="noopener noreferrer">Testing Mobile: Emulators, Simulators And Remote Debugging</a>(\u82F1)</li><li><a href="https://sebastianblade.com/debug-ios-safari-with-chrome-devtools/" target="_blank" rel="noopener noreferrer">\u5982\u4F55\u7528 Chrome DevTools \u8C03\u8BD5 iOS Safari</a></li><li><a href="https://discussions.youdaxue.com/t/ios/37374" target="_blank" rel="noopener noreferrer">\u57FA\u4E8E iOS \u8BBE\u5907\u7684\u79FB\u52A8\u7AEF\u524D\u7AEF\u5F00\u53D1\u8C03\u8BD5 - \u8BBA\u575B</a></li></ul>',49);function _(f,v){return b}var S=o(u,[["render",_]]);export{S as default};
